from befree.api_model.config.headers import Headersfrom befree.api_model.orders.public.payment_available.endpoints import Endpointsfrom befree.api_model.orders.public.payment_available.payloads import Payloadsfrom befree.api_model import apifrom requests import Responseclass PaymentAvailable:    def __init__(self):        self._endpoints = Endpoints()        self._payloads = Payloads()        self._headers = Headers()    def get_payments_available(self, cart_uuid):        response: Response = api.orders_session.post(            url=self._endpoints.get_payments_available,            data=self._payloads.get_payments_available(cart_uuid=cart_uuid),            headers=self._headers.common,        )        return response